import React, { Component } from "react";

class apicall extends Component {
  constructor() {
    super();
    this.state = {
      weather: [],
    };
  }

  componentDidMount() {
    fetch("http://ip-api.com/json/")
      .then((results) => {
        return results.json();
      })
      .then((data) => {
        let weather = data.results.map((wea) => {
          return (
            <div key={wea.results}>
              <p>{wea}</p>
            </div>
          );
        });
        this.setState({ weather: weather });
        console.log("state", this.state.weather);
      });
  }

  render() {
    return (
      <div className="container2">
        <div className="container1">{this.state.weather}</div>
      </div>
    );
  }
}

export default apicall;
